Lens Construction:3 elements in 2 groups<br>Compatible for Adapter Ring:Panasonic Lumix H-PS14042 and H-H014 Lenses<br>Maximum Image Magnification:H-PS14042: x 0.35 at tele<br>H-H014: x 0.14<br>Closest Focusing Distance:H-PS14042: 0.16m / 0.52ft at wide  0.18m / 0.59ft at tele<br>H-H014: 0.14m / 0.46ft<br>Longest Focusing Distance:H-PS14042: 0.26m / 0.85ft<br>H-H014: 0.23m / 0.75ft<br>Max. Diameter:53.5mm / 2.1''<br>Overall Length:24.2mm / 1.0'' (from the tip of the lens to the base side of the lens mount)<br>Weight:46g / 1.6oz (excluding lens cap and lens rear cap)<br><br><br>・Enables shooting macro shot easily<br>・Features closest focusing distance of 0.14m<br>・Compact  lightweight design featuring high mobility<br>・Included Adaptor Ring for the use on H-PS14042 and H-H014<br>・Helpful in shooting descriptive subject such as flowers or insects<br><br><br>The Panasonic DMW-GMC1 Macro Conversion Lens is designed to fit on a selection of Panasonic Lumix G lenses. It essentially allows you to focus closer to the subject. Its compact and lightweight design is helpful in shooting subjects such as flowers and insects. <br><br> &bull  This Accessory works with: <br> DMC-GF5  DMC-GF3  DMC-GH2  DMC-GX1  DMC-G3  H-PS14042K  H-PS14042S  H-H014 <br><br></DIV>
