TravelCoatTM Nikon 200VR... <br><br> TravelCoat covers are made of 3mm thick shock-absorbing closed cell neoprene. Custom tailored to fit you lens providing protection allowing you more valuable room for packing and storage. Slides over lens quickly and easily with a Velcro closure. <br><br> Use with the appropriate Hoodie for complete lens protection. TravelCoats are available in Black  Forest Green  Realtree Max4 HD  Realtree Hardwoods Snow  and Digital Camo. * Works great with a LensCoat lens cover. <br><br></DIV>
