Construction:Both lens and camera mount ends: brass and plated with chromium<br><br><br>・Both camera-side and lens-side of the adapter are made of brass  precision-machined and plated with chromium<br>・Satin surface finish - just like your OEM lens and camera mounts<br>・Precise fit and solid connection - lens has no play  gap or wiggling when mounted on adapter and no adjustments are required to fit your lens<br>・Designed to reach infinity focus while maintaining the correct registration distance required to maintain optical quality of CRC lenses or lenses with floating elements<br><br><br>The Metabones Arriflex Lens to Micro 4/3 Adapter features robust build quality and outstanding finish. Both camera-side and lens-side of the adapter is made of brass  precision-machined and plated with chromium.</DIV>
