LensCoat for the Canon 1200mm f/5.6 ... <br><br> LensCoatTM telephoto lens covers offers your valuable equipment some protection from scrapes and bumps  preserving its resale value. It also helps break up the shape of your lens  making it less noticeable to wildlife. <br><br> The LensCoat 1200 features a clear plastic windows over the auto focus and focus limiter controls  and also the distance scale. A small hole on the last segment lines up with the red dot indicator  making it easy to quickly line up your lens with camera mount even with the cover installed. <br><br></DIV>
